    return(
        <section>
            <header>

            </header>    
            <article>
                <ul>
                    {props.allFish.map(ele=><li>{ele.name['name-USen']}</li>)}
                </ul>

             </article>
       </section>    
    );
}
function ActionAreaCard(props) {
    return (
      <Card sx={{ maxWidth: 345 }}>
        <CardActionArea>
          <CardMedia
            component="img"
            height="340"
            image={props.fish.image_uri}
            alt="fish"
          />
          <CardContent>
            <Typography gutterBottom variant="h5" component="div">
            {props.fish['file-name']}
            </Typography>
          </CardContent>
        </CardActionArea>
      </Card>
    );
  }

export default AllFish;
